/*!50003 CREATE*/ /*!50017 DEFINER=`admin_m`@`%`*/ /*!50003 TRIGGER `actualizar_stock` AFTER INSERT ON `DETALLE_VENTA` FOR EACH ROW begin
	update LIBRO_EN_VENTA
	set Stock = Stock - new.cantidad
	where ISBN = new.ISBN;
end */;;
