/*!50003 CREATE*/ /*!50017 DEFINER=`admin_m`@`%`*/ /*!50003 TRIGGER `actualizar_precioTotal_insert` AFTER INSERT ON `DETALLE_VENTA` FOR EACH ROW begin
	declare total decimal(10,2);

	select sum(cantidad * precio_unitario) into total
	from DETALLE_VENTA 
	where id_venta = new.id_venta;

	update VENTA 
	set Precio_total = total
	where ID_venta = new.id_venta;
end */;;
